import React from "react";
import { styled } from "@mui/material/styles";
import Post from "./Post";

const StyledContainer = styled("div")(({ theme }) => ({
  paddingTop: theme.spacing(10),
}));

function Feed() {
  return (
    <div>
      <StyledContainer>
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
      </StyledContainer>
    </div>
  );
}

export default Feed;
